using UnityEngine;

public class MaterialPropertyReader : MonoBehaviour
{
    public string targetGameObject = "Cube"; // Name of the GameObject to inspect

    void Start()
    {
        GameObject obj = GameObject.Find(targetGameObject);
        if (obj != null)
        {
            MeshRenderer renderer = obj.GetComponent<MeshRenderer>();
            if (renderer != null)
            {
                Material material = renderer.sharedMaterial;
                if (material != null)
                {
                    Debug.Log($"Material Name: {material.name}");

                    // Get Albedo Color (Base Color in URP Lit Shader)
                    if (material.HasProperty("_BaseColor"))
                    {
                        Color albedoColor = material.GetColor("_BaseColor");
                        Debug.Log($"Albedo Color: R={albedoColor.r}, G={albedoColor.g}, B={albedoColor.b}, A={albedoColor.a}");
                    }
                    else
                    {
                        Debug.Log("Material does not have _BaseColor property.");
                    }

                    // Get Emission Color
                    if (material.HasProperty("_EmissionColor"))
                    {
                        Color emissionColor = material.GetColor("_EmissionColor");
                        Debug.Log($"Emission Color: R={emissionColor.r}, G={emissionColor.g}, B={emissionColor.b}, A={emissionColor.a}");
                    }
                    else
                    {
                        Debug.Log("Material does not have _EmissionColor property.");
                    }

                    // Get other common properties for URP Lit Shader
                    if (material.HasProperty("_Smoothness"))
                    {
                        float smoothness = material.GetFloat("_Smoothness");
                        Debug.Log($"Smoothness: {smoothness}");
                    }
                    if (material.HasProperty("_Metallic"))
                    {
                        float metallic = material.GetFloat("_Metallic");
                        Debug.Log($"Metallic: {metallic}");
                    }
                    if (material.HasProperty("_BumpScale"))
                    {
                        float normalScale = material.GetFloat("_BumpScale");
                        Debug.Log($"Normal Map Scale: {normalScale}");
                    }
                    if (material.HasProperty("_OcclusionStrength"))
                    {
                        float occlusionStrength = material.GetFloat("_OcclusionStrength");
                        Debug.Log($"Occlusion Strength: {occlusionStrength}");
                    }
                }
                else
                {
                    Debug.LogError($"GameObject '{targetGameObject}' has no material assigned to its MeshRenderer.");
                }
            }
            else
            {
                Debug.LogError($"GameObject '{targetGameObject}' has no MeshRenderer component.");
            }
        }
        else
        {
            Debug.LogError($"GameObject '{targetGameObject}' not found in the scene.");
        }
    }
}
