{"name": "manage_script", "args": {"namespace": "MaterialPropertyExtractor", "name": "MaterialPropertyExtractor", "path": "/", "contents": "
using UnityEngine;

namespace MaterialPropertyExtractor
{
    public class MaterialPropertyExtractor : MonoBehaviour
    {
        public GameObject targetGameObject;

        void Start()
        {
            if (targetGameObject == null)
            {
                Debug.LogError("Target GameObject is not assigned.");
                return;
            }

            MeshRenderer meshRenderer = targetGameObject.GetComponent<MeshRenderer>();
            if (meshRenderer == null)
            {
                Debug.LogError("No MeshRenderer found on the target GameObject.");
                return;
            }

            Material material = meshRenderer.sharedMaterial;
            if (material == null)
            {
                Debug.LogError("No material found on the MeshRenderer.");
                return;
            }

            Debug.Log($"Material Name: {material.name}");
            Debug.Log($"Shader Name: {material.shader.name}");

            // Get Albedo Color
            if (material.HasProperty("_BaseColor"))
            {
                Debug.Log($"Albedo Color (BaseColor): {material.GetColor("_BaseColor")}");
            }
            else if (material.HasProperty("_Color"))
            {
                Debug.Log($"Albedo Color (Color): {material.GetColor("_Color")}");
            }

            // Get Emission Color
            if (material.HasProperty("_EmissionColor"))
            {
                Debug.Log($"Emission Color: {material.GetColor("_EmissionColor")}");
            }

            // Get Smoothness/Glossiness
            if (material.HasProperty("_Smoothness"))
            {
                Debug.Log($"Smoothness: {material.GetFloat("_Smoothness")}");
            }
            else if (material.HasProperty("_Glossiness"))
            {
                Debug.Log($"Glossiness: {material.GetFloat("_Glossiness")}");
            }

            // Get Metallic
            if (material.HasProperty("_Metallic"))
            {
                Debug.Log($"Metallic: {material.GetFloat("_Metallic")}");
            }

            // Get Render Mode (e.g., Opaque, Cutout, Fade, Transparent)
            if (material.HasProperty("_Surface")) // URP specific
            {
                Debug.Log($"Surface Type (URP): {material.GetFloat("_Surface")}");
            }
            else if (material.HasProperty("_Mode")) // Standard shader specific
            {
                Debug.Log($"Render Mode (Standard): {material.GetFloat("_Mode")}");
            }

            // You can add more properties as needed based on the shader
            // For example, textures:
            if (material.HasProperty("_BaseMap"))
            {
                Texture albedoTexture = material.GetTexture("_BaseMap");
                if (albedoTexture != null)
                {
                    Debug.Log($"Albedo Texture (BaseMap): {albedoTexture.name}");
                }
            }
            if (material.HasProperty("_EmissionMap"))
            {
                Texture emissionTexture = material.GetTexture("_EmissionMap");
                if (emissionTexture != null)
                {
                    Debug.Log($"Emission Texture (EmissionMap): {emissionTexture.name}");
                }
            }
        }
    }
}
